INSERT INTO `clinics` VALUES (9,'Bệnh viện Đa khoa Quy Nhơn','Số 219 Lê Duẩn - Hai Bà Trưng - Quy Nhơn','GIỚI THIỆU\n\nĐịa chỉ: 219 Lê Duẩn, Hai Bà Trưng, Quy Nhơn\n\nThời gian làm việc: \n\nThứ 2 đến Chủ Nhật\nTừ 7h30 đến 17h00\nBệnh viện Đa khoa Hồng Phát được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện Đa khoa Hồng Phát hội tụ đội ngũ giáo sư, bác sĩ đầu ngành có chuyên môn cao và giàu kinh nghiệm. Hầu hết các y, bác sĩ đang làm việc tại đây đều là những người đã và đang công tác tại các bệnh viện lớn tuyến Trung ương như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện E Hà Nội, Bệnh viện K, Bệnh viện TW Quân đội 108, Bệnh viện Phụ sản TW,…\n\nHình thức thanh toán: Bệnh viện nhận thanh toán bằng tiền mặt và quẹt thẻ.\n\nTHẾ MẠNH CHUYÊN MÔN\nThế mạnh: Bệnh viện có thế mạnh chuyên môn về khám và điều trị bệnh lý Nội Cơ Xương Khớp, Nội Thần Kinh với những chuyên gia đầu ngành trong lĩnh vực này như: Giáo sư, Tiến sĩ Trần Ngọc Ân, Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Văn Liệu,..\n\nKhám và điều trị\n\nBệnh viện nhận khám và điều trị về:\n\nNội cơ xương khớp\nNội thần kinh\nNội tiết, đái tháo đường, tim mạch – Nội chung\nChuyên khoa tiêu hóa – Hậu môn trực tràng\nSản phụ khoa\nDa liễu\nMắt','<p>GIỚI THIỆU</p>\n<p>Địa chỉ: 219 Lê Duẩn, Hai Bà Trưng, Quy Nhơn</p>\n<p>Thời gian làm việc:</p>\n<p>Thứ 2 đến Chủ Nhật\nTừ 7h30 đến 17h00\nBệnh viện Đa khoa Hồng Phát được Bộ Y tế thẩm định và cấp phép hoạt động từ đầu năm 2007. Bệnh viện Đa khoa Hồng Phát hội tụ đội ngũ giáo sư, bác sĩ đầu ngành có chuyên môn cao và giàu kinh nghiệm. Hầu hết các y, bác sĩ đang làm việc tại đây đều là những người đã và đang công tác tại các bệnh viện lớn tuyến Trung ương như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện E Hà Nội, Bệnh viện K, Bệnh viện TW Quân đội 108, Bệnh viện Phụ sản TW,…</p>\n<p>Hình thức thanh toán: Bệnh viện nhận thanh toán bằng tiền mặt và quẹt thẻ.</p>\n<p>THẾ MẠNH CHUYÊN MÔN\nThế mạnh: Bệnh viện có thế mạnh chuyên môn về khám và điều trị bệnh lý Nội Cơ Xương Khớp, Nội Thần Kinh với những chuyên gia đầu ngành trong lĩnh vực này như: Giáo sư, Tiến sĩ Trần Ngọc Ân, Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Văn Liệu,..</p>\n<p>Khám và điều trị</p>\n<p>Bệnh viện nhận khám và điều trị về:</p>\n<p>Nội cơ xương khớp\nNội thần kinh\nNội tiết, đái tháo đường, tim mạch – Nội chung\nChuyên khoa tiêu hóa – Hậu môn trực tràng\nSản phụ khoa\nDa liễu\nMắt</p>\n',_binary 'blob:http://localhost:3000/f7d6f01e-737a-4682-8fa9-88dfeb0b9c6c','2022-02-15 12:06:33','2024-05-19 17:22:31');
