INSERT INTO `markdowns` VALUES (1,'<h3><strong>1.Giáo sư, Huỳnh Minh Đức</strong></h3>\n<ul>\n<li>\n<p>Danh hiệu Thầy thuốc Nhân dân</p>\n</li>\n<li>\n<p>Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh</p>\n</li>\n<li>\n<p>Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai</p>\n</li>\n<li>\n<p>Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội</p>\n</li>\n</ul>\n<h3><strong>2.Quá trình công tác</strong></h3>\n<ul>\n<li>\n<p>PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai</p>\n</li>\n<li>\n<p>Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Viện trưởng Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (2008 – 2011)</p>\n</li>\n<li>\n<p>Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)</p>\n</li>\n<li>\n<p>Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (1995 – 2008)</p>\n</li>\n<li>\n<p>Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)</p>\n</li>\n<li>\n<p>Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thầnTrường Đại học Y Hà Nội (1978 - 1994)</p>\n</li>\n</ul>\n<h3><strong>3.Quá trình đào tạo</strong></h3>\n<ul>\n<li>\n<p>Giảng viên cao cấp chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2014)</p>\n</li>\n<li>\n<p>Phó Giáo sư chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2007)</p>\n</li>\n<li>\n<p>Tiến sĩ chuyên ngành Tâm thần, Trường Đại học Y Hà Nội (2003)</p>\n</li>\n<li>\n<p>Sách và các công trình nghiên cứu khoa học</p>\n</li>\n<li>\n<p>Tham gia biên soạn chủ biên và đồng chủ biên 16 đầu sách là giáo trình giảng dạy, sách chuyên khảo chuyên ngành Tâm thần học và y học nói chung (2003 - 2018)</p>\n</li>\n<li>\n<p>Trên 50 công trình nghiên cứu khoa học đăng tải trong các tạp chí khoa học có uy tín (Tạp chí Nghiên cứu khoa học Đại học Y Hà Nội, tạp chí Tổng hội Y Dược học Việt Nam, tạp chí Y học thực hành Bộ Y tế, tạp chí Hội Tâm thần học Việt Nam). (1992 - 2020)</p>\n</li>\n<li>\n<p>Hướng dẫn bảo vệ thành công 31 luận án Tiến sĩ, luận văn Thạc sĩ, Bác sĩ chuyên khoa cấp 2, Bác sĩ nội trú Bệnh viện, Y tế công cộng Đại học Y Hà Nội (2003 - 2020)</p>\n</li>\n<li>\n<p>Thành viên các hội khoa học, tổ chức chuyên môn</p>\n</li>\n<li>\n<p>Ban chấp hành Hội Tâm thần học Việt Nam</p>\n</li>\n<li>\n<p>Phó Chủ tịch Hội đồng khoa học Viện Nghiên cứu Điều trị các bệnh hiểm nghèo</p>\n</li>\n<li>\n<p>Khám và điều trị</p>\n</li>\n</ul>\n<h3><strong>4.Bác sĩ nhận khám các vấn đề:</strong></h3>\n<ul>\n<li>\n<p>Các rối loạn giấc ngủ: Mất ngủ, ngủ nhiều, ác mộng, hoảng sợ khi ngủ, rối loạn nhịp thức ngủ, đi trong giấc ngủ (chứng miên hành).</p>\n</li>\n<li>\n<p>Các rối loạn liên quan đến Stress và dạng cơ thể:</p>\n</li>\n<li>\n<p>Đau dai dẳng các loại: Đau đầu, đau ngực, đau bụng, đau mọi vị trí không xác định trong cơ thể.</p>\n</li>\n<li>\n<p>Rối loạn thần kinh thực vật</p>\n</li>\n<li>\n<p>Rối loạn hệ thống tim mạch: Tim đập nhanh, hồi hộp đánh trống ngực, cảm giác đè nặng ngực, nghẹt thở, huyết áp dao động.</p>\n</li>\n<li>\n<p>Rối loạn dạ dày - ruột: đau bụng, đầy hơi, trào ngược dạ dày, trào ngược thực quản.</p>\n</li>\n<li>\n<p>Rối loạn hệ thống hô hấp: Tức ngực, khó thở, đoản hơi.</p>\n</li>\n<li>\n<p>Rối loạn hệ thống tiết niệu - sinh dục: Đái nhiều, đái nóng, đái dắt; giảm ham muốn tình dục, nam rối loạn cương, nữ rối loạn kinh nguyệt.</p>\n</li>\n<li>\n<p>Rối loạn sự thích ứng:</p>\n</li>\n<li>\n<p>Trầm cảm: Buồn chán, mất thích thú, mệt mỏi, vô lực, giảm tập trung chú ý, kém tự tin, nhìn tương lai ảm đạm và bi quan.</p>\n</li>\n<li>\n<p>Lo âu, rối loạn cảm xúc và hành vi,…</p>\n</li>\n<li>\n<p>Các rối loạn cảm xúc: Trầm cảm, hưng cảm, cảm xúc dao động, …</p>\n</li>\n<li>\n<p>Các rối loạn tâm ký nặng: Hoang tưởng, Ảo giác, rối loạn phân liệt,…</p>\n</li>\n<li>\n<p>Trẻ em: Tự kỷ, tăng động giảm chú ý, tíc, đái dầm, ỉa đùn, nói lắp, trầm cảm, rối loạn cảm xúc và hành vi, rối loạn vận động định hình.</p>\n</li>\n<li>\n<p>Người già: Trầm cảm, sa sút trí tuệ, lú lẫn, hoang tưởng, ảo giác.</p>\n</li>\n<li>\n<p>Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh,…</p>\n</li>\n<li>\n<p>Rối loạn ăn uống: Chán ăn, ăn vô độ, béo phì.</p>\n</li>\n<li>\n<p>Rối loạn tình dục: Mất ham muốn, xuất tinh sớm, bất lực, lãnh cảm, đau khi giao hợp, rối loạn phân định giới tính,…</p>\n</li>\n<li>\n<p>Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, …</p>\n</li>\n</ul>\n<p><strong>Một vài hình ảnh về phòng khám bệnh của bác sĩ:</strong>\n<img src=\"https://raw.githubusercontent.com/haryphamdev/sharing-host-files/master/detail-doctors/46195.jpg\" alt=\"img\"></p>\n','### **1.Giáo sư, Huỳnh Minh Đức**\n\n* Danh hiệu Thầy thuốc Nhân dân\n\n* Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\n\n* Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai\n\n* Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội\n\n\n### **2.Quá trình công tác**\n* PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội\n\n* Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai\n\n* Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội\n\n* Viện trưởng Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (2008 – 2011)\n\n* Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)\n\n* Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (1995 – 2008)\n\n* Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)\n\n* Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thầnTrường Đại học Y Hà Nội (1978 - 1994)\n\n### **3.Quá trình đào tạo**\n* Giảng viên cao cấp chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2014)\n\n* Phó Giáo sư chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2007)\n\n* Tiến sĩ chuyên ngành Tâm thần, Trường Đại học Y Hà Nội (2003)\n\n* Sách và các công trình nghiên cứu khoa học\n\n* Tham gia biên soạn chủ biên và đồng chủ biên 16 đầu sách là giáo trình giảng dạy, sách chuyên khảo chuyên ngành Tâm thần học và y học nói chung (2003 - 2018)\n\n* Trên 50 công trình nghiên cứu khoa học đăng tải trong các tạp chí khoa học có uy tín (Tạp chí Nghiên cứu khoa học Đại học Y Hà Nội, tạp chí Tổng hội Y Dược học Việt Nam, tạp chí Y học thực hành Bộ Y tế, tạp chí Hội Tâm thần học Việt Nam). (1992 - 2020)\n\n* Hướng dẫn bảo vệ thành công 31 luận án Tiến sĩ, luận văn Thạc sĩ, Bác sĩ chuyên khoa cấp 2, Bác sĩ nội trú Bệnh viện, Y tế công cộng Đại học Y Hà Nội (2003 - 2020)\n\n* Thành viên các hội khoa học, tổ chức chuyên môn\n\n* Ban chấp hành Hội Tâm thần học Việt Nam\n\n* Phó Chủ tịch Hội đồng khoa học Viện Nghiên cứu Điều trị các bệnh hiểm nghèo\n\n* Khám và điều trị\n\n\n### **4.Bác sĩ nhận khám các vấn đề:**\n* Các rối loạn giấc ngủ: Mất ngủ, ngủ nhiều, ác mộng, hoảng sợ khi ngủ, rối loạn nhịp thức ngủ, đi trong giấc ngủ (chứng miên hành).\n\n* Các rối loạn liên quan đến Stress và dạng cơ thể:\n* Đau dai dẳng các loại: Đau đầu, đau ngực, đau bụng, đau mọi vị trí không xác định trong cơ thể.\n\n* Rối loạn thần kinh thực vật\n\n* Rối loạn hệ thống tim mạch: Tim đập nhanh, hồi hộp đánh trống ngực, cảm giác đè nặng ngực, nghẹt thở, huyết áp dao động.\n* Rối loạn dạ dày - ruột: đau bụng, đầy hơi, trào ngược dạ dày, trào ngược thực quản.\n\n* Rối loạn hệ thống hô hấp: Tức ngực, khó thở, đoản hơi.\n\n* Rối loạn hệ thống tiết niệu - sinh dục: Đái nhiều, đái nóng, đái dắt; giảm ham muốn tình dục, nam rối loạn cương, nữ rối loạn kinh nguyệt.\n\n* Rối loạn sự thích ứng:\n\n\n* Trầm cảm: Buồn chán, mất thích thú, mệt mỏi, vô lực, giảm tập trung chú ý, kém tự tin, nhìn tương lai ảm đạm và bi quan.\n\n* Lo âu, rối loạn cảm xúc và hành vi,…\n\n* Các rối loạn cảm xúc: Trầm cảm, hưng cảm, cảm xúc dao động, …\n\n* Các rối loạn tâm ký nặng: Hoang tưởng, Ảo giác, rối loạn phân liệt,…\n\n* Trẻ em: Tự kỷ, tăng động giảm chú ý, tíc, đái dầm, ỉa đùn, nói lắp, trầm cảm, rối loạn cảm xúc và hành vi, rối loạn vận động định hình.\n* Người già: Trầm cảm, sa sút trí tuệ, lú lẫn, hoang tưởng, ảo giác.\n* Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh,…\n\n* Rối loạn ăn uống: Chán ăn, ăn vô độ, béo phì.\n\n* Rối loạn tình dục: Mất ham muốn, xuất tinh sớm, bất lực, lãnh cảm, đau khi giao hợp, rối loạn phân định giới tính,…\n* Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, …\n\n**Một vài hình ảnh về phòng khám bệnh của bác sĩ:**\n![img](https://raw.githubusercontent.com/haryphamdev/sharing-host-files/master/detail-doctors/46195.jpg)','Bác sĩ đầu ngành chuyên khoa Cơ xương khớp\nNguyên Viện trưởng Viện Sức khoẻ Cơ xương khớp quốc gia, Bệnh viện Hữu nghị Việt Đức\nNguyên Phó Chủ nhiệm Bộ môn Tâm thần trường Đại học Y Hà Nội\nLƯU Ý: BÁC SĨ CHỈ NHẬN TƯ VẤN TỪ XA TRONG GIAI ĐOẠN DỊCH COVID-19',18,NULL,NULL,'2022-02-09 14:10:09','2022-05-25 20:50:14'),(2,'<h3><strong>1.Tiến sĩ, Huỳnh Quốc Cường</strong></h3>\n<ul>\n<li>\n<p>Danh hiệu Thầy thuốc Nhân dân</p>\n</li>\n<li>\n<p>Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh</p>\n</li>\n<li>\n<p>Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai</p>\n</li>\n<li>\n<p>Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội</p>\n</li>\n</ul>\n<h3><strong>2.Quá trình công tác</strong></h3>\n<ul>\n<li>\n<p>PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai</p>\n</li>\n<li>\n<p>Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Viện trưởng Viện Sức khoẻ Tâm 