n liên quan đến Stress và dạng cơ thể:</p>\n</li>\n<li>\n<p>Đau dai dẳng các loại: Đau đầu, đau ngực, đau bụng, đau mọi vị trí không xác định trong cơ thể.</p>\n</li>\n<li>\n<p>Rối loạn thần kinh thực vật</p>\n</li>\n<li>\n<p>Rối loạn hệ thống tim mạch: Tim đập nhanh, hồi hộp đánh trống ngực, cảm giác đè nặng ngực, nghẹt thở, huyết áp dao động.</p>\n</li>\n<li>\n<p>Rối loạn dạ dày - ruột: đau bụng, đầy hơi, trào ngược dạ dày, trào ngược thực quản.</p>\n</li>\n<li>\n<p>Rối loạn hệ thống hô hấp: Tức ngực, khó thở, đoản hơi.</p>\n</li>\n<li>\n<p>Rối loạn hệ thống tiết niệu - sinh dục: Đái nhiều, đái nóng, đái dắt; giảm ham muốn tình dục, nam rối loạn cương, nữ rối loạn kinh nguyệt.</p>\n</li>\n<li>\n<p>Rối loạn sự thích ứng:</p>\n</li>\n<li>\n<p>Trầm cảm: Buồn chán, mất thích thú, mệt mỏi, vô lực, giảm tập trung chú ý, kém tự tin, nhìn tương lai ảm đạm và bi quan.</p>\n</li>\n<li>\n<p>Lo âu, rối loạn cảm xúc và hành vi,…</p>\n</li>\n<li>\n<p>Các rối loạn cảm xúc: Trầm cảm, hưng cảm, cảm xúc dao động, …</p>\n</li>\n<li>\n<p>Các rối loạn tâm ký nặng: Hoang tưởng, Ảo giác, rối loạn phân liệt,…</p>\n</li>\n<li>\n<p>Trẻ em: Tự kỷ, tăng động giảm chú ý, tíc, đái dầm, ỉa đùn, nói lắp, trầm cảm, rối loạn cảm xúc và hành vi, rối loạn vận động định hình.</p>\n</li>\n<li>\n<p>Người già: Trầm cảm, sa sút trí tuệ, lú lẫn, hoang tưởng, ảo giác.</p>\n</li>\n<li>\n<p>Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh,…</p>\n</li>\n<li>\n<p>Rối loạn ăn uống: Chán ăn, ăn vô độ, béo phì.</p>\n</li>\n<li>\n<p>Rối loạn tình dục: Mất ham muốn, xuất tinh sớm, bất lực, lãnh cảm, đau khi giao hợp, rối loạn phân định giới tính,…</p>\n</li>\n<li>\n<p>Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, …</p>\n</li>\n</ul>\n<p><strong>Một vài hình ảnh về phòng khám bệnh của bác sĩ:</strong>\n<img src=\"https://raw.githubusercontent.com/haryphamdev/sharing-host-files/master/detail-doctors/46195.jpg\" alt=\"img\"></p>\n','### **1.Tiến sĩ, Huỳnh Quốc Cường**